INSERT INTO `his_config_info` VALUES (1566, 1731, 'erahub-base', '88e4c82ee78a6aca602b911149dd4fcf', '', '{\"app\":\"erahub-base\",\"revision\":\"88e4c82ee78a6aca602b911149dd4fcf\",\"services\":{\"com.erahub.base.system.api.RemoteLogService:dubbo\":{\"name\":\"com.erahub.base.system.api.RemoteLogService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"saveLog,saveLogininfor\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.system.api.RemoteLogService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.system.api.RemoteLogService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.system.api.RemoteUserService:dubbo\":{\"name\":\"com.erahub.base.system.api.RemoteUserService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"getUserInfoByPhonenumber,registerUserInfo,getUserInfoByOpenid,getUserInfo\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.system.api.RemoteUserService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.system.api.RemoteUserService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.basicservice.api.RemoteSmsService:dubbo\":{\"name\":\"com.erahub.base.basicservice.api.RemoteSmsService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"send\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.basicservice.api.RemoteSmsService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.basicservice.api.RemoteSmsService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.system.api.RemoteDataScopeService:dubbo\":{\"name\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"getDeptAndChild,getRoleCustom\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.basicservice.api.RemoteFileService:dubbo\":{\"name\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"upload,clearTempFiles,deleteByIds,deleteByUrls\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.basicservice.api.RemoteMailService:dubbo\":{\"name\":\"com.erahub.base.basicservice.api.RemoteMailService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"sendWithAttachment,send\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.basicservice.api.RemoteMailService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.basicservice.api.RemoteMailService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.system.api.RemoteDictService:dubbo\":{\"name\":\"com.erahub.base.system.api.RemoteDictService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.0\",\"methods\":\"getDictLabel,getDictValue\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.system.api.RemoteDictService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.system.api.RemoteDictService\",\"port\":20880,\"protocol\":\"dubbo\"}}}', 'a84a8b644f7fc66d537bbe55c2456104', '2022-12-10 11:51:00', '2022-12-10 03:51:01', NULL, '192.168.10.2', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (169, 1732, 'application-common.yml', 'DEFAULT_GROUP', '', 'server:\n  # undertow 配置\n  undertow:\n    # HTTP post内容的最大大小。当值为-1时，默认值为大小是无限的\n    max-http-post-size: -1\n    # 以下的配置会影响buffer,这些buffer会用于服务器连接的IO操作,有点类似netty的池化内存管理\n    # 每块buffer的空间大小,越小的空间被利用越充分\n    buffer-size: 512\n    # 是否分配的直接内存\n    direct-buffers: true\n    threads:\n      # 设置IO线程数, 它主要执行非阻塞的任务,它们会负责多个连接, 默认设置每个CPU核心一个线程\n      io: 8\n      # 阻塞任务线程池, 当执行类似servlet请求阻塞操作, undertow会从这个线程池中取得线程,它的值设置取决于系统的负载\n      worker: 256\n\ndubbo:\n  application:\n    logger: slf4j\n    # 元数据中心 local 本地 remote 远程 这里使用远程便于其他服务获取\n    metadataType: remote\n    # 可选值 interface、instance、all，默认是 all，即接口级地址、应用级地址都注册\n    register-mode: instance\n    service-discovery:\n      # FORCE_INTERFACE，只消费接口级地址，如无地址则报错，单订阅 2.x 地址\n      # APPLICATION_FIRST，智能决策接口级/应用级地址，双订阅\n      # FORCE_APPLICATION，只消费应用级地址，如无地址则报错，单订阅 3.x 地址\n      migration: FORCE_APPLICATION\n  protocol:\n    # 设置为 tri 即可使用 Triple 3.0 新协议\n    # 性能对比 dubbo 协议并没有提升 但基于 http2 用于多语言异构等 http 交互场景\n    # 使用 dubbo 协议通信\n    name: dubbo\n    # dubbo 协议端口(-1表示自增端口,从20880开始)\n    port: -1\n    # 指定dubbo协议注册ip\n    # host: 192.168.0.100\n  # 注册中心配置\n  registry:\n    address: nacos://${spring.cloud.nacos.server-addr}\n    group: DUBBO_GROUP\n    parameters:\n      namespace: ${spring.profiles.active}\n  # 消费者相关配置\n  consumer:\n    # 结果缓存(LRU算法)\n    # 会有数据不一致问题 建议在注解局部开启\n    cache: false\n    # 支持校验注解\n    validation: true\n    # 超时时间\n    timeout: 3000\n    # 初始化检查\n    check: false\n  scan:\n    # 接口实现类扫描\n    base-packages: com.erahub.**.dubbo\n  # 自定义配置\n  custom:\n    # 全局请求log\n    request-log: true\n    # info 基础信息 param 参数信息 full 全部\n    log-level: info\n\nspring:\n  # 资源信息\n  messages:\n    # 国际化资源文件路径\n    basename: i18n/messages\n  servlet:\n    multipart:\n      # 整个请求大小限制\n      max-request-size: 30MB\n      # 上传单个文件大小限制\n      max-file-size: 30MB\n  #jackson配置\n  jackson:\n    # 日期格式化\n    date-format: yyyy-MM-dd HH:mm:ss\n    serialization:\n      # 格式化输出\n      INDENT_OUTPUT: false\n      # 忽略无法转换的对象\n      fail_on_empty_beans: false\n    deserialization:\n      # 允许对象忽略json中不存在的属性\n      fail_on_unknown_properties: false\n  cloud:\n    # sentinel 配置\n    sentinel:\n      # sentinel 开关\n      enabled: true\n      # 取消控制台懒加载\n      eager: true\n      transport:\n        # dashboard控制台服务名 用于服务发现\n        # 如无此配置将默认使用下方 dashboard 配置直接注册\n        server-name: erahub-sentinel-dashboard\n        # 客户端指定注册的ip 用于多网卡ip不稳点使用\n        # client-ip:\n        # 控制台地址 从1.3.0开始使用 server-name 注册\n        # dashboard: localhost:8718\n\n  # redis通用配置 子服务可以自行配置进行覆盖\n  redis:\n    host: localhost\n    port: 6379\n    # 密码(如没有密码请注释掉)\n    # password: erahub123\n    database: 0\n    timeout: 10s\n    ssl: false\n\n# redisson 配置\nredisson:\n  # redis key前缀\n  keyPrefix:\n  # 线程池数量\n  threads: 4\n  # Netty线程池数量\n  nettyThreads: 8\n  # 单节点配置\n  singleServerConfig:\n    # 客户端名称\n    clientName: ${spring.application.name}\n    # 最小空闲连接数\n    connectionMinimumIdleSize: 8\n    # 连接池大小\n    connectionPoolSize: 32\n    # 连接空闲超时，单位：毫秒\n    idleConnectionTimeout: 10000\n    # 命令等待超时，单位：毫秒\n    timeout: 3000\n    # 发布和订阅连接池大小\n    subscriptionConnectionPoolSize: 50\n\n# 分布式锁 lock4j 全局配置\nlock4j:\n  # 获取分布式锁超时时间，默认为 3000 毫秒\n  acquire-timeout: 3000\n  # 分布式锁的超时时间，默认为 30 秒\n  expire: 30000\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: ALWAYS\n    logfile:\n      external-file: ./logs/${spring.application.name}/console.log\n\n# 日志配置\nlogging:\n  level:\n    org.springframework: warn\n    org.apache.dubbo: warn\n    com.alibaba.nacos: warn\n  config: classpath:logback.xml\n\n# Sa-Token配置\nsa-token:\n  # token名称 (同时也是cookie名称)\n  token-name: Authorization\n  # token有效期 设为一天 (必定过期) 单位: 秒\n  timeout: 86400\n  # token临时有效期 (指定时间无操作就过期) 单位: 秒\n  activity-timeout: 1800\n  # 开启内网服务调用鉴权\n  check-id-token: true\n  # Id-Token的有效期 (单位: 秒)\n  id-token-timeout: 600\n  # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录)\n  is-concurrent: true\n  # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token)\n  is-share: false\n  # 是否尝试从header里读取token\n  is-read-head: true\n  # 是否尝试从cookie里读取token\n  is-read-cookie: false\n  # token前缀\n  token-prefix: \"Bearer\"\n  # jwt秘钥\n  jwt-secret-key: abcdefghijklmnopqrstuvwxyz\n  # 是否输出操作日志\n  is-log: true\n\n# MyBatisPlus配置\n# https://baomidou.com/config/\nmybatis-plus:\n  # 不支持多包, 如有需要可在注解配置 或 提升扫包等级\n  # 例如 com.**.**.mapper\n  mapperPackage: com.erahub.**.mapper\n  # 对应的 XML 文件位置\n  mapperLocations: classpath*:mapper/**/*Mapper.xml\n  # 实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.erahub.**.domain\n  # 启动时是否检查 MyBatis XML 文件的存在，默认不检查\n  checkConfigLocation: false\n  configuration:\n    # 自动驼峰命名规则（camel case）映射\n    mapUnderscoreToCamelCase: true\n    # MyBatis 自动映射策略\n    # NONE：不启用 PARTIAL：只对非嵌套 resultMap 自动映射 FULL：对所有 resultMap 自动映射\n    autoMappingBehavior: PARTIAL\n    # MyBatis 自动映射时未知列或未知属性处理策\n    # NONE：不做处理 WARNING：打印相关警告 FAILING：抛出异常和详细信息\n    autoMappingUnknownColumnBehavior: NONE\n    # 更详细的日志输出 会有性能损耗 org.apache.ibatis.logging.stdout.StdOutImpl\n    # 关闭日志记录 (可单纯使用 p6spy 分析) org.apache.ibatis.logging.nologging.NoLoggingImpl\n    # 默认日志输出 org.apache.ibatis.logging.slf4j.Slf4jImpl\n    logImpl: org.apache.ibatis.logging.nologging.NoLoggingImpl\n  global-config:\n    # 是否打印 Logo banner\n    banner: true\n    dbConfig:\n      # 主键类型\n      # AUTO 自增 NONE 空 INPUT 用户输入 ASSIGN_ID 雪花 ASSIGN_UUID 唯一 UUID\n      idType: ASSIGN_ID\n      # 逻辑已删除值\n      logicDeleteValue: 2\n      # 逻辑未删除值\n      logicNotDeleteValue: 0\n      insertStrategy: NOT_NULL\n      updateStrategy: NOT_NULL\n      where-strategy: NOT_NULL\n\n# swagger配置\nswagger:\n  # 是否开启swagger\n  enabled: true\n  info:\n    # 标题\n    title: \'标题：erahub-auth-plus微服务权限管理系统_接口文档\'\n    # 描述\n    description: \'描述：微服务权限管理系统, 具体包括XXX,XXX模块...\'\n    # 版本\n    version: \'版本号：系统版本...\'\n    # 作者信息\n    contact:\n      name: erahub\n      email: erahub@163.com\n      url: https://gitee.com/erahub\n  components:\n    # 鉴权方式配置\n    security-schemes:\n      apiKey:\n        type: APIKEY\n        in: HEADER\n        name: ${sa-token.token-name}\n  # 服务文档路径映射 参考 gateway router 配置\n  # 默认为服务名去除前缀转换为path 此处填特殊的配置\n  service-mapping:\n    erahub-base: /code\n\n# seata配置\nseata:\n  # 默认关闭，如需启用spring.datasource.dynami.seata需要同时开启\n  enabled: true\n  # Seata 应用编号，默认为 ${spring.application.name}\n  application-id: ${spring.application.name}\n  # Seata 事务组编号，用于 TC 集群名\n  tx-service-group: ${spring.application.name}-group\n  config:\n    type: nacos\n    nacos:\n      server-addr: ${spring.cloud.nacos.server-addr}\n      group: ${spring.cloud.nacos.config.group}\n      namespace: ${spring.profiles.active}\n      data-id: seata-server.properties\n  registry:\n    type: nacos\n    nacos:\n      application: erahub-seata-server\n      server-addr: ${spring.cloud.nacos.server-addr}\n      group: ${spring.cloud.nacos.discovery.group}\n      namespace: ${spring.profiles.active}\n', 'a0372917d2d76a21363f36854ab0878d', '2022-12-10 11:52:04', '2022-12-10 03:52:04', 'nacos', '127.0.0.1', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (179, 1733, 'erahub-xxl-job-admin.yml', 'DEFAULT_GROUP', '', '# server 配置\r\nspring:\r\n  datasource:\r\n    type: com.zaxxer.hikari.HikariDataSource\r\n    driver-class-name: com.mysql.cj.jdbc.Driver\r\n    url: ${datasource.job.url}\r\n    username: ${datasource.job.username}\r\n    password: ${datasource.job.password}\r\n    hikari:\r\n      auto-commit: true\r\n      connection-test-query: SELECT 1\r\n      connection-timeout: 10000\r\n      idle-timeout: 30000\r\n      max-lifetime: 900000\r\n      maximum-pool-size: 30\r\n      minimum-idle: 10\r\n      pool-name: HikariCP\r\n      validation-timeout: 1000\r\n  mail:\r\n    from: xxx@qq.com\r\n    host: smtp.qq.com\r\n    username: xxx@qq.com\r\n    password: xxx\r\n    port: 25\r\n    properties:\r\n      mail:\r\n        smtp:\r\n          auth: true\r\n          socketFactory:\r\n            class: javax.net.ssl.SSLSocketFactory\r\n          starttls:\r\n            enable: true\r\n            required: true\r\n\r\n# mybatis 配置\r\nmybatis:\r\n  mapper-locations: classpath:/mybatis-mapper/*Mapper.xml\r\n\r\n# Actuator 监控端点的配置项\r\nmanagement:\r\n  health:\r\n    mail:\r\n      enabled: false\r\n\r\n# xxljob系统配置\r\nxxl:\r\n  job:\r\n    # 鉴权token\r\n    accessToken: xxl-job\r\n    # 国际化\r\n    i18n: zh_CN\r\n    # 日志清理\r\n    logretentiondays: 30\r\n    triggerpool:\r\n      fast:\r\n        max: 200\r\n      slow:\r\n        max: 100\r\n', '0c1e10f72c999b9b567f1fa073b6f500', '2022-12-10 11:52:49', '2022-12-10 03:52:49', 'nacos', '127.0.0.1', 'U', 'dev', '');
